var meant=require("meant");var output=require("./output.js");function didYouMean(b,a){var c=meant(b,a).map(function(d){return"    "+d});if(c.length===0){return}if(c.length===1){output("\nDid you mean this?\n"+c[0])}else{output(["\nDid you mean one of these?"].concat(c.slice(0,3)).join("\n"))}}module.exports=didYouMean;